CREATE TABLE mytable(
   id                INTEGER  NOT NULL PRIMARY KEY 
  ,email             VARCHAR(255)
  ,vehicle_licence   VARCHAR(255) NOT NULL
  ,date              VARCHAR(255) NOT NULL
  ,service_type      VARCHAR(255) NOT NULL
  ,make              VARCHAR(255)
  ,service_option    VARCHAR(255)
  ,service_item_spec VARCHAR(255)
  ,manufacturer      VARCHAR(255)
  ,material_cost     VARCHAR(255)
  ,labour_cost       VARCHAR(255)
  ,other_cost        VARCHAR(255)
  ,total_cost        VARCHAR(255)
  ,service_note      VARCHAR(255)
  ,mileage           VARCHAR(255)
  ,chassis_no        VARCHAR(255)
  ,location          VARCHAR(255)
  ,file              VARCHAR(255)
  ,updated_by        VARCHAR(255)
);
